import React from 'react';
import wlc from './pics/pageNotFound.pnj';
const PageNotFound = (props) => {
  return (
    <div className="404">
      <img src={wlc} alt=''></img>
      <div>404 Page Not Found</div>
      <p>No Match For {props.location.pathname}</p>
    </div >
  )
}

export default PageNotFound
